import ReactDOM from 'react-dom';

const element = (
    <div>
        <h1>My todo list</h1>
    <input placeholder="search"/>
    <ul>
        <li>Learn react</li>
        <li>Learn docker</li>
        <li>Learn AWS</li>
    </ul>
    </div>
);
ReactDOM.render(element, document.getElementById('root'));
